import ExpenseItem from "./components/ExpenseItem";

function App() {

  const expenses=[
    {
      "id": "61cd5aab5b2c5331cae30e7e",
      "title": "CORECOM",
      "amount": "$3,413.82",
      "date": "2017-02-27"
    },
    {
      "id": "61cd5aab7666348c61b2d94a",
      "title": "ZENTIME",
      "amount": "$1,315.06",
      "date": "2014-01-21"
    },
    {
