      "amount": "$1,435.25",
      "date": "2018-12-25"
    },
    {
      "id": "61cd5aabe09998286f7836c7",
      "title": "BUZZMAKER",
      "amount": "$2,568.23",
      "date": "2021-10-19"
    },
    {
      "id": "61cd5aab491fa89cc5afff48",
      "title": "TERRAGO",
      "amount": "$1,554.93",
      "date": "2014-05-23"
    },
    {
      "id": "61cd5aab21869746d89a9823",
      "title": "BISBA",
      "amount": "$3,422.55",
      "date": "2016-10-30"
    },
    {
      "id": "61cd5aab0da24a11f9c63789",
      "title": "MEDALERT",
      "amount": "$3,031.89",
      "date": "2014-10-17"
    },
    {
      "id": "61cd5aab77b1a1544f0fb289",
      "title": "VIAGRAND",
      "amount": "$2,685.05",
      "date": "2018-07-19"
    },
    {
      "id": "61cd5aabd983c4fe00bc5c18",
      "title": "COMTRAIL",
      "amount": "$3,347.12",
      "date": "2018-10-27"
    },
    {
      "id": "61cd5aaba44dc42faf8ef0a0",
      "title": "ORGANICA",
      "amount": "$3,941.83",
      "date": "2017-07-23"
    }
  ]

  return (
    <div>
   <ol>{
  expenses.map(el=>{
    return ( <li key={el.key}><ExpenseItem key={el.key} date={el.date} title={el.title} amount={el.amount}></ExpenseItem></li>);
  })
}</ol>
</div>
  );
}

export default App;
